    \ Domestic Noir Plot\n\n\n\n\nTop 10 Generator\xF3w\n1. Nazwa postaci 2. Rapper\
    \ Name3. Quick Name4. Rap Lyrics6. Band Name7. Username8. Fantasy Name9. Story10.\
    \ (ang.). Oficjalna strona Freestyle Song Lyrics\n\nPlot Generator\n\n\n\nNie\
    \ uratowa\u0142 Jumpa na opcje, komentowania i g\u0142osowania.\nHungry Obfus\
    \ Currrr\nA Short Story (ang.).\nJim\nObfus Curr patrzy\u0142 na osobliwy n\xF3\
    \u017C w d\u0142oniach i boi si\u0119.\nPrzeszed\u0142 do okna i odbija\u0142\
    \ si\u0119 na jego straszne otoczenie. Zawsze uwielbia\u0142 fotograficzne Falmouth\
    \ ze swymi niepokojonymi rowami. By\u0142o to miejsce, w kt\xF3rym zach\u0119\
    ca\u0142 swoj\u0105 tendencj\u0119 do odczuwania si\u0119.\nWtedy widzia\u0142\
    \ co\u015B w odleg\u0142o\u015Bci, a nie kogo\u015B. By\u0142a to posta\u0107\
    \ Ambien Cain. Ambien by\u0142 mi\u0142o\u015Bnym s\u0142oniem z szerokimi wartami\
    \ i os\u0142upkami oczu.\nObfus gulped. Zaznaczy\u0142 si\u0119 w\u0142asnym odbiciem.\
    \ By\u0142 g\u0142odnym, sprytnym, winopij\u0105cym si\u0119 na przystojnych wartach\
    \ i br\u0105zowym oczu. Jego przyjaciele widzieli go jako szerok\u0105, dzikiego\
    \ przyjaciela. Po pewnym czasie wznowi\u0142 \u015Bmier\u0107, rannego ptaka.\
    \ Jednak nie nawet g\u0142odna osoba, kt\xF3ra po raz pierwszy od\u017Cy\u0142\
    a umieraj\u0105cego, rannego ptaka, zosta\u0142a przygotowana do tego, co Ambien\
    \ posiada\u0142 w magazynie. P\u0142yn\u0105ce deszcze uderza\u0142y jak podzi\u0119\
    kuj\u0105ce ptaki, czyni\u0105c Obfus ambiwalentne.\nGdy Obfus by\u0142 zdezerterowany\
    \ i Ambien zbli\u017Cy\u0142 si\u0119 do siebie, zobaczy\u0142 na jego twarzy\
    \ u\u015Bmiech.\n\"Jestem tutaj dlatego, \u017Ce chc\u0119 sprawiedliwo\u015B\u0107\
    \", Ambien bellowed. Zawali\u0142 swoje pi\u0119\u015Bcie przeciw niemu Obfusowi,\
    \ z si\u0142\u0105 5874 niebieskich butelek. \"Zakochana mi\u0142o\u015B\u0107\
    , Obfus Curr\".\nObfus odwr\xF3ci\u0142 si\u0119, nawet bardziej ambiwalentny\
    \ i wci\u0105\u017C pali nikogo. \"Nie mam pieni\u0119dzy\" odpowiedzia\u0142\
    .\nWygl\u0105dali ze sob\u0105 aktywne uczucia, jak np. dwa bezruchowe, wspania\u0142\
    e maggoty \u015Bmiej\u0105 si\u0119 z bardzo rozwa\u017Cnego bara mitzvah, kt\xF3\
    ry mia\u0142 muzyk\u0119 klasyczn\u0105 w tle, a dw\xF3ch wuj\xF3w my\u015Bl\u0105\
    c o rytmie.\nObfus bada\u0142 szerokie warty Ambiena i spiky eyelashes. W ko\u0144\
    cu zaczerpn\u0105\u0142 g\u0142\u0119bokie oddechy. \"Nie mog\u0119 da\u0107 sprawiedliwo\u015B\
    ci, ale nie mog\u0119 da\u0107 sprawiedliwo\u015Bci\", wyt\u0142umaczy\u0142 na\
    \ zabawki.\nAmbien wygl\u0105da\u0142 na nie\u0142adny, a jego cia\u0142o by\u0142\
    o tak samo nowoczesne.\nObfus m\xF3g\u0142 s\u0142ysze\u0107 cia\u0142o Ambiena\
    \ w 3833 kawa\u0142ki. Wtedy uwolni\u0142 si\u0119 s\u0142onia w kierunku odleg\u0142\
    o\u015Bci. Nie ma nawet szk\u0142a wina spokojnie obfusa.\nD\n\nZ przyczyn prywatno\u015B\
