    da\u0142 na nie\u0142adny, a jego cia\u0142o by\u0142o tak samo nowoczesne.\n\
    Obfus m\xF3g\u0142 s\u0142ysze\u0107 cia\u0142o Ambiena w 3833 kawa\u0142ki. Wtedy\
