  p1626256393.3948069: "Obfus Curr patrzy\u0142 na osobliwy n\xF3\u017C w d\u0142\
    oniach i boi si\u0119."
  p1626256393.3948078: "Przeszed\u0142 do okna i odbija\u0142 si\u0119 na jego straszne\
    \ otoczenie. Zawsze uwielbia\u0142 fotograficzne Falmouth ze swymi niepokojonymi\
    \ rowami. By\u0142o to miejsce, w kt\xF3rym zach\u0119ca\u0142 swoj\u0105 tendencj\u0119\
    \ do odczuwania si\u0119."
  p1626256393.3948088: "Wtedy widzia\u0142 co\u015B w odleg\u0142o\u015Bci, a nie\
    \ kogo\u015B. By\u0142a to posta\u0107 Ambien Cain. Ambien by\u0142 mi\u0142o\u015B\
    nym s\u0142oniem z szerokimi wartami i os\u0142upkami oczu."
  p1626256393.3948095: "Obfus gulped. Zaznaczy\u0142 si\u0119 w\u0142asnym odbiciem.\
    \ By\u0142 g\u0142odnym, sprytnym, winopij\u0105cym si\u0119 na przystojnych wartach\
    \ i br\u0105zowym oczu. Jego przyjaciele widzieli go jako szerok\u0105, dzikiego\
    \ przyjaciela. Po pewnym czasie wznowi\u0142 \u015Bmier\u0107, rannego ptaka."
  p1626256393.3948107: "Jednak nie nawet g\u0142odna osoba, kt\xF3ra po raz pierwszy\
    \ od\u017Cy\u0142a umieraj\u0105cego, rannego ptaka, zosta\u0142a przygotowana\
    \ do tego, co Ambien posiada\u0142 w magazynie."
  p1626256393.3948114: "P\u0142yn\u0105ce deszcze uderza\u0142y jak podzi\u0119kuj\u0105\
    ce ptaki, czyni\u0105c Obfus ambiwalentne."
  p1626256393.3948123: "Gdy Obfus by\u0142 zdezerterowany i Ambien zbli\u017Cy\u0142\
    \ si\u0119 do siebie, zobaczy\u0142 na jego twarzy u\u015Bmiech."
  p1626256393.3948133: "\"Jestem tutaj dlatego, \u017Ce chc\u0119 sprawiedliwo\u015B\
    \u0107\", Ambien bellowed. Zawali\u0142 swoje pi\u0119\u015Bcie przeciw niemu\
    \ Obfusowi, z si\u0142\u0105 5874 niebieskich butelek. \"Zakochana mi\u0142o\u015B\
    \u0107, Obfus Curr\"."
  p1626256393.3948143: "Obfus odwr\xF3ci\u0142 si\u0119, nawet bardziej ambiwalentny\
    \ i wci\u0105\u017C pali nikogo. \"Nie mam pieni\u0119dzy\" odpowiedzia\u0142."
  p1626256393.3948152: "Wygl\u0105dali ze sob\u0105 aktywne uczucia, jak np. dwa bezruchowe,\
    \ wspania\u0142e maggoty \u015Bmiej\u0105 si\u0119 z bardzo rozwa\u017Cnego bara\
    \ mitzvah, kt\xF3ry mia\u0142 muzyk\u0119 klasyczn\u0105 w tle, a dw\xF3ch wuj\xF3\
    w my\u015Bl\u0105c o rytmie."
  p1626256393.394816: "Obfus bada\u0142 szerokie warty Ambiena i spiky eyelashes.\
    \ W ko\u0144cu zaczerpn\u0105\u0142 g\u0142\u0119bokie oddechy. \"Nie mog\u0119\
    \ da\u0107 sprawiedliwo\u015Bci, ale nie mog\u0119 da\u0107 sprawiedliwo\u015B\
    ci\", wyt\u0142umaczy\u0142 na zabawki."
  p1626256393.394817: "Ambien wygl\u0105da\u0142 na nie\u0142adny, a jego cia\u0142\
    o by\u0142o tak samo nowoczesne."
  p1626256393.3948178: "Obfus m\xF3g\u0142 s\u0142ysze\u0107 cia\u0142o Ambiena w\
    \ 3833 kawa\u0142ki. Wtedy uwolni\u0142 si\u0119 s\u0142onia w kierunku odleg\u0142\
    o\u015Bci."
  p1626256393.3948188: "Nie ma nawet szk\u0142a wina spokojnie obfusa."
